"use strict";

var TimerStore = require("../app/stores/timer-store"),
    constants = require("../app/constants"),
    actions = require("../app/actions"),
    AppDispatcher = require("../app/appdispatcher");

describe("TimerStore", function () {

    beforeEach(function () {});

    describe("isReadyToStart", function () {
        var timerId = 0;

        afterEach(function () {
            try {
                actions.stopTimer(timerId);
            } catch (e) {}
            timerId++;
        });

        it("should return false for unset timers", function () {
            expect(TimerStore.isReadyToStart(timerId)).toBe(false);
        });

        it("should return start for set timers", function () {
            actions.setTimer(timerId, 5);
            expect(TimerStore.isReadyToStart(timerId)).toBe(true);
        });

        it("should return false if running", function () {
            actions.setTimer(timerId, 5);
            actions.startTimer(timerId);
            expect(TimerStore.isRunning(timerId)).toBe(true);
            expect(TimerStore.isReadyToStart(timerId)).toBe(false);
        });

        it("should return true if stopped after being started", function () {
            actions.setTimer(timerId, 5);
            actions.startTimer(timerId);
            actions.stopTimer(timerId);
            expect(TimerStore.isReadyToStart(timerId)).toBe(true);
        });
    });
});

